import React from 'react';
import {
  View,
  Text,
  SafeAreaView,
  ScrollView,
  TouchableOpacity,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { styles } from '../styles-part/HomeScreenStyles';
import SafeMitraLogo from '../../components/SafeMitraLogo';

const HomeScreen = ({ navigation }) => {
  return (
    <SafeAreaView style={styles.container}>
      <ScrollView contentContainerStyle={styles.scrollContainer}>
        <View style={styles.header}>
          <View style={styles.logoContainer}>
            <SafeMitraLogo color="#FF3B30" size={30} />
            <Text style={styles.logoText}>SafeMitra</Text>
          </View>
        </View>

        <View style={styles.welcomeContainer}>
          <Text style={styles.welcomeTitle}>Welcome to SafeMitra</Text>
          <Text style={styles.welcomeSubtitle}>Your safety companion</Text>
        </View>

        {/* Placeholder for main content */}
        <View style={styles.contentContainer}>
          <Text style={styles.contentText}>Home Screen Content Coming Soon</Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

export default HomeScreen;
